<template>
    <el-row :gutter="20">
        <el-col v-for="video in videos" :key="video.id" :span="4">
            <div class="video__poster" @click="onClickVideo(video)">
                <el-image :src="video.poster" fit="cover" />
                <el-icon size="45px" color="var(--el-color-white)"><VideoPlay /></el-icon>
            </div>

            <h4>{{ video?.name }}</h4>
        </el-col>
    </el-row>

    <el-dialog custom-class="el-dialog--video" v-model="dialogVisible" :title="currentVideo?.name" @closed="onDialogClosed" @opened="onDialogOpened" :show-close="false">
        <video ref="video" :src="currentVideo?.src" controls />
    </el-dialog>
</template>

<script lang="ts" setup>
import { ref } from 'vue';
import type { Ref } from 'vue';
import type { Video } from '@/types';

const videos: Video[] = [
    {
        id: 1,
        name: 'Подруливатель Кампус. Обучение и настройка.',
        src: 'https://commondatastorage.googleapis.com/gtv-videos-bucket/sample/BigBuckBunny.mp4',
        poster: 'data:image/jpeg;base64,'
    },
    {
        id: 2,
        name: 'Подруливатель Кампус. Обучение и настройка.',
        src: 'https://commondatastorage.googleapis.com/gtv-videos-bucket/sample/ElephantsDream.mp4',
        poster: 'data:image/jpeg;base64,'
    },
    {
        id: 3,
        name: 'Подруливатель Кампус. Обучение и настройка.',
        src: 'https://commondatastorage.googleapis.com/gtv-videos-bucket/sample/ForBiggerBlazes.mp4',
        poster: 'data:image/jpeg;base64,'
    },
    {
        id: 4,
        name: 'Подруливатель Кампус. Обучение и настройка.',
        src: 'https://commondatastorage.googleapis.com/gtv-videos-bucket/sample/ForBiggerEscapes.mp4',
        poster: 'data:image/jpeg;base64,'
    },
    {
        id: 5,
        name: 'Подруливатель Кампус. Обучение и настройка.',
        src: 'https://commondatastorage.googleapis.com/gtv-videos-bucket/sample/ForBiggerFun.mp4',
        poster: 'data:image/jpeg;base64,'
    },
    {
        id: 6,
        name: 'Подруливатель Кампус. Обучение и настройка.',
        src: 'https://commondatastorage.googleapis.com/gtv-videos-bucket/sample/ForBiggerJoyrides.mp4',
        poster: 'data:image/jpeg;base64,'
    },
    {
        id: 7,
        name: 'Подруливатель Кампус. Обучение и настройка.',
        src: 'https://commondatastorage.googleapis.com/gtv-videos-bucket/sample/ForBiggerMeltdowns.mp4',
        poster: 'data:image/jpeg;base64,'
    }
];

const dialogVisible = ref(false);
const currentVideo: Ref<Video | null> = ref(null);
const video: Ref<HTMLVideoElement | null> = ref(null);

const onClickVideo = (video: Video) => {
    currentVideo.value = video;
    dialogVisible.value = true;
};

const onDialogOpened = () => {
    video.value?.play();
};

const onDialogClosed = () => {
    if (!video.value) return;

    video.value.pause();
    video.value.currentTime = 0;
};
</script>

